import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";
import "./Company.css";

function Company(props) {
  const { company } = props;
  return (
    <div className="food">
      <img src={company.img} />
      <h2>{company.name}</h2>
      <h2>{company.category}</h2>
      <div className="ratings">
        <h3>
          <img src="https://img.pixers.pics/pho_wat(s3:700/FO/51/85/10/18/700_FO51851018_370576a4820b976f8ae4abc3e11a8b19.jpg,20,20,cms:2018/10/5bd1b68f678a7_250x45-watermark-wzory-izolowane.png,over,217,468,jpg)/duvar-cikartmalari-beyaz-zemin-uzerine-altin-yildiz-simgesi.jpg.jpg" />
          {company.ratings}
        </h3>
        <h3>{company.deliveryTime}</h3>
      </div>
    </div>
  );
}

export default Company;
